import React from "react";
import "../styles/tags.sass";

function Tags(props) {
    const { lodging } = props; // Utilisez "lodging" pour accéder aux données de logement

    return (
      <ul className='Tags-element'>
        {lodging.map((lodgingItem, index) => {
          const { tags } = lodgingItem;
          return (
            <div className="lodgingElement" key={index}>
              <li className="tags">{tags}</li>
            </div>
          );
        })}
      </ul>
    );
}

export default Tags;
